import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import img1 from "./assets/my new.png";

function App() {
  return (
    <div className="top">
      <h1>FACEBOOK</h1>
      <div>
        {" "}
        <img className="picss" src={img1} width="100%" alt="new" />
      </div>
    </div>
  );
}

ReactDOM.render(<App />, document.querySelector("#root"));

